Below are three example Java programs. Copy each program to a new file in your workspace and try running it. If you're unable to run a program, then ask for help! All programs should work as long as you're using Java 23 with preview features enabled. Program 1: Hello.java void main() { println("Hello Zach, welcome to CSC110!");
} Program 2: FullName.java void main() { var firstName = readln("What is your first name? "); var lastName = readln("What is your last name? "); println("Your full name is " + firstName + " " + lastName + ".");
} Program 3: Add.java void main() { var x = Integer.parseInt(readln("Please enter an integer. ")); var sum = x + 1; println(sum);
} Once you've run each of the programs, try making the following changes: Make Hello.java greet you instead of your professor. Make FullName.java print the user's name in "Last, First" format instead of "First Last". For example, "Kohlberg, Zach" instead of "Zach Kohlberg". Make Add.java read two numbers from the user and print their sum instead of reading a single number and printing that number plus one. We haven't explained what this code does yet, but I want you to try figuring it out based on the working examples. It's okay if this takes some trial and error. We'll learn more about how these programs work next week.
